import React from 'react';
import { Skeleton } from '@mui/material';

function generateRandomInteger(max) {
	return Math.floor(Math.random() * max) + 1;
}

function Loading() {
	return (
		<>
			<Skeleton
				variant='rectangular'
				height={40}
				width={generateRandomInteger(200)}
