				style={{ marginBottom: '5px', borderRadius: '20px' }}
			/>
			<Skeleton
				variant='rectangular'
				height={40}
				width={generateRandomInteger(200)}
				style={{ marginBottom: '5px', borderRadius: '20px' }}
			/>
		</>
	);
}

export default Loading;
